import React, { Component } from "react";

import "./App.css";

class App extends Component {
  render() {
    const name = "john Doe";
    const loading = false;
    const showName = true;
    return (
      <div className="App">
        {loading ? <h4>Loading...</h4> : <h1>Hello From {name && showName}</h1>}
      </div>
    );
  }
}

export default App;
